import React, {Component} from 'react';
class Card extends Component {
  state = {
    try: [
      {
        test: 'something new',
        test1: 'react'

      }, {
        test: 'something old',
        test1: 'angular'
      }
    ]
  }
    render() {
      const options = this.state.try.map((item, index) =>
        <div className="card col-sm-12 col-md-6 col-lg-4" key={index}>
          <div className="card-body">
            <p className="card-title">{`${item.test} in ${item.test1}`}</p>
            <button className="button">MORE INFO</button>
          </div>
        </div>
      )
      return (
        <div className="git-card container-fluid">
            <div className="row">
              {options}
          </div>
      </div>);
    }
  }
export default Card;
